import React, { Component } from 'react';

class TopNavRightIcon extends Component {
    
    render() {
        return (
        <a
            href={props.href}
            title={props.title}
            id={props.id}
        >
            {props.media}
            <i
                className={props.className}
            >

            </i>
        </a>
    );
    }
};

export default TopNavRightIcon;
